import ArrowBackIcon from "@mui/icons-material/ArrowBack";

export const CountryDetails = () => {
  return (
      <div className="country_details">
          <button className="back">
              <ArrowBackIcon/>
            <p>Go to Back</p>
          </button>

          <div className="country_details_body">
              <div className="img_container">
              </div>

              <div className="info">
                  <h2>name</h2>
                  <div className=""></div>
              </div>
          </div>

      </div>
  )
};
